import {gql} from '@apollo/client'

export const AIRING_NOW = gql`
{
  Page(page: 1, perPage: 10){
    pageinfo{
      lastpage
    }
    media(type: ANIME, isAdult: false, season: SPRING, seasonYear: 2021){
      title{
        english
        romanji
      }
      genres
      description
      coverImage{
        medium large
        extralarge
      }
      studios
      }
    }
  }
}
`
